import React, { Component } from 'react';
import {Jumbotron, Button} from "react-bootstrap";
import Image from "react-bootstrap/Image";
import "./hunter-james-fAOqScBvMSc-unsplash.jpg"
import PageHeader from "../PageAttributes/PageHeader";
import SearchBackground from "./hunter-james-fAOqScBvMSc-unsplash.jpg"

class HomePage extends Component {

    render() {
        return (
            <div>
                <PageHeader />
                <Jumbotron>
                    <h1>Hello</h1>
                    <p>sample</p>
                    <img style={"jumbotron"} src={SearchBackground} alt={"SearchBackground"}fluid/>
                </Jumbotron>
            </div>
        );
    }

}

export default HomePage;
